import React from "react";
import { useNavigate } from "react-router-dom";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useRouteMatch,
    useParams
} from "react-router-dom";


export default function Titlebar() {

    const navigate = useNavigate();

    const navigateToMovies = () => {
        // üëáÔ∏è navigate to /contacts
        window.location.href = "/movies";
    };

    const navigateHome = () => {
        // üëáÔ∏è navigate to /
        window.location.href = "/";
    };


    return (
        <div className="titlebar">
            <div className="leftside">
                <div className="title--title">Movie Recommendations</div>
                <div className="Description">
                    <div className="firstline">Find out what movies you're into.</div>
                    <div className="secondline">Search for a movie and discover an entire world of cinema at the palm of your hand.</div>
                </div>
            </div>
            <div className="rightside">

                <table className="navigation">
                    <tr>
                        <td onClick={navigateHome}>Home</td>
                    </tr>
                    <tr>
                        <td onClick={navigateToMovies}>Movies</td>
                    </tr>
                    <tr>
                        <td>Contact</td>
                    </tr>
                </table>
            </div>
        </div >

    );
}
